import { Component } from '@angular/core';

@Component({
  selector: 'app-navbar',
  templateUrl: './navbar.component.html',
  styleUrls: ['./navbar.component.scss']
})
export class NavbarComponent {

}
<nav class="navbar">
  <ol>
    <li>Home</li>
    <li>Sobre mi</li>
    <li>Mis proyectos</li>
    <li>Contacto</li>
  </ol>
</nav>
